#include <stdio.h>#include <iostream>using namespace std;int findmax(int a[5]){	int x=0;	int index;	for (int j=0; j<5; j++){		if (a[j]>x){			x=a[j];			index = j;		}	}	return index;}int main() {	int x=0, y=0;	int a[5], b[3];	for (int i=0; i<5; i++)		cin >> a[i];	for (int j=0; j<3; j++){		y=findmax(a);		b[j]=a[y];		a[y]=0;	}cout << b[0] <<" "<< b[1] <<" "<< b[2] << endl;}